import hotel1 from "../assets/hotel-1.jpg";

const hotels = [
    { id: 1, ville: "Boulevard Martin Luther King Dakar, 11500", nom: "Hotel Terrou-Bi", prix: 25.000? image: hotel1 },
    { id: 2, ville: "Rte des Almadies, Dakar", nom: "King Fahd Palace", prix: 20.000? image: hotel },
    { id: 3, ville: "Rte de la Corniche 0, Dakar 16868", nom: "Radisson Blu Hotel", prix: 22.000? image: hotel },
    { id: 4, ville: "place de l'indépendance, 10 Rue PL 29, Dakar", nom: "Pullman Dakar Teranga", prix: 30.000? image: hotel },
    { id: 5, ville: "Lac Rose, Dakar", nom: "Hotel Lac Rose", prix: 25.000? image: hotel },
    { id: 6, ville: "Mbour, Sénégal", nom: "Hotel Saly", prix: 20.000? image: hotel },
    { id: 7, ville: "Bp64, Saly 23000", nom: "Palm Beach Resort & Spa", prix: 22.000? image: hotel },
    { id: 8, ville: "Place de l'indépendance, 10 Rue PL 29, Dakar", nom: "Pullman Dakar Teranga", prix: 30.000? image: hotel }
];

export default hotels;
